window.bookSummaryJSON = "<p>The de Moray witches are back, and this time there's hell to pay.... </p> <p><b>Claire</b> </p> <p>How does a fire witch battle her feelings for a sexy apocalyptic horseman when he's burned his way into her heart? </p> <p>In a world now plagued with signs of the four opened seals, Claire must choose between her loyalty to her sisters and her longing to embrace her taste for War. When faced with a new evil, will Claire's desperate attempt to fix the past incinerate them all? </p> <p><b>Aerin</b> </p> <p>How does an air witch learn to fly when she's falling for the wrong man? </p> <p>With an army of vengeful undead rattling the gates, Aerin feels powerless to save her sisters from their ominous destiny. Turning to Pestilence for help is the first in a series of choices that might tempt her to embrace her darker nature. When faced with a whirlwind of dangerous decisions, she's left to wonder: does the end justify the means? </p> <p><b>Tierra</b> </p> <p>How does an earth witch come to terms with the fact that she and Death created a life? </p> <p>Consumed with the terrifying possibility that she's carrying the antichrist, Tierra must also contend with her sisters dabbling in the dark arts. But will Tierra's newfound powers help stop the apocalypse or widen the growing chasm between them all? </p> <p><b>Moira</b> </p> <p>How does a water witch stay afloat when she finds herself at the mercy of a man who has none? </p> <p>Kidnapped by Conquest and separated from her sisters, Moira must face down not only the demons within herself, but also a force whose lust for power could destroy everything she loves. But when Moira learns of a new threat larger than anything she or her sisters had ever imagined, will joining forces with Conquest turn the tide for good...or evil? </p> <p>The de Moray sisters will have a devil of a time fighting the most sinister threat they've encountered yet...the wickedness within. </p>"; 
